import React from "react";
import "./Login.css";

const Login = () => {
  return (
    <div className="login">
      <div className="title"></div>
      <div className="form">
        <input type="text" placeholder="전화번호, 사용자 이름 또는 이메일"></input>
        <input type="password" placeholder=""></input>
      </div>
      <div className="loginButton">
        <button>로그인</button>
      </div>
    </div>
  );
};

export default Login;
